import styled from 'styled-components';

const Styled = styled.img``;

const Barbell = ({ styl }) => {
  return (
    <Styled
      style={{ styl }}
      className='barbell'
      src='olympic_barbell.svg'
      alt='barbell'
    />
  );
};

export default Barbell;
